import '../Style/Video.css'

function splitParam(url){
    const query = url.split('?')[1]
    const params = query.split('&')
}

export default function Video(props) {
    return (<>
        <div className="videoContainer">
            {props.origin === "external" 
            ? 
            <iframe className='video' title={props.title} src={props.src} controls preload='auto' frameborder="0"></iframe> 
            : 
            <video src={props.src} controls preload='auto' crossOrigin='anonymous' className="video"></video>}
        </div>
    </>)
}
